import Container from "react-bootstrap/esm/Container";
import mySkills from "./MySkills";
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import SkillItem from './SkillItem';
import Card from 'react-bootstrap/Card';

Object.keys(mySkills).map((key) => {
    Object.keys(mySkills[key]).map((innerKey) => {
        console.log(`${key}: ${innerKey} : ${mySkills[key][innerKey]}`)
    })
    console.log('------------------')
})



function Skills() {

    


    return (

        <section className = 'myskills-section Poppins' id ='skills'>
            <Container fluid>

            <Col className ='myskills-header'>
                <h1>My Skills</h1>
            </Col>

            
            {
                Object.keys(mySkills).map((key) => {
                
                return <div>
                            <Row className = 'skill-row mt-5 pt-5 mb-3'>
                            <h1 className = 'skill-header'>{key}</h1>
                            <Row className=''>
                            {Object.keys(mySkills[key]).map((innerKey) => {
                        return <Col md={1} ><SkillItem skillName = {innerKey} img= {innerKey} key = {innerKey} progress = {mySkills[key][innerKey]} /></Col>
                    })}
                            </Row>
                        </Row>


                    </div>
                        
                    
                })
                
            }

            <Card style={{ width: '18rem' }}>
                <Card.Img variant="top" src="holder.js/100px180" />
                <Card.Body>
                    <Card.Title>Card Title</Card.Title>
                    <Card.Text>
                    Some quick example text to build on the card title and make up the
                    bulk of the card's content.
                    </Card.Text>
                    <Button variant="primary">Go somewhere</Button>
                </Card.Body>
                </Card>
                   
                
            
            
            <br /><br /><br /><br /><br /><br /> <br /><br /><br /><br /><br /><br />
            </Container>
        </section>


    )



}

export default Skills;
